   useEffect(() => {
      gsap.registerPlugin(ScrollTrigger);

      let title = document.querySelector('.partners__wrapper .content__wrapper .title__wrapper h5');
      let logoWrapper1 = document.querySelectorAll('.partners__wrapper .content__wrapper .logos__wrapper .logo__wrapper');
      let logoWrapper2 = document.querySelectorAll('.partners__wrapper .content__wrapper .logos-wrapper__mobile .logo__wrapper');

      gsap.to(title, {
         y: 0,
         scrollTrigger: {
            trigger: title,
            start: 'top bottom',
            end: 'top center',
            scrub: true
         }
      });

      gsap.to(logoWrapper1, {
         opacity: 1,
         scrollTrigger: {
            trigger: logoWrapper1,
            start: 'top bottom',
            end: 'top center',
            scrub: true
         }
      });

      gsap.to(logoWrapper2, {
         opacity: 1,
         scrollTrigger: {
            trigger: logoWrapper2,
            start: 'top bottom',
            end: 'top center',
            scrub: true
         }
      });
   }, [])

